INSERT INTO `wp_postmeta` VALUES (58,380,'_elementor_data','[{\"id\":\"6ed8285e\",\"elType\":\"container\",\"settings\":[],\"elements\":[{\"id\":\"75a294d0\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<h2>Article 1 : Mentions l\\u00e9gales.<\\/h2>\\n<p>L\\u2019\\u00e9dition du Site est assur\\u00e9e par la soci\\u00e9t\\u00e9 SARL PLUS UN MUSIC SERVICES au capital de 1 000 \\u20ac, inscrite au RCS sous le num\\u00e9ro 830848883, dont le si\\u00e8ge social est localis\\u00e9 au 23-25 rue Ledion, 75014 Paris. T\\u00e9l : +33 7 66 70 56 81, Email : contact@plusunmusic.com<br>\\nL\\u2019h\\u00e9bergeur du Site est la soci\\u00e9t\\u00e9 Hostinger International Ltd, soci\\u00e9t\\u00e9 priv\\u00e9e \\u00e0 responsabilit\\u00e9 limit\\u00e9e de Chypre, dont le si\\u00e8ge social est situ\\u00e9 au 61 Lordou Vironos str. 6023 Larnaca, Chypre. Contact : https:\\/\\/www.hostinger.fr\\/contact<br>\\nDirecteur de la publication : Monsieur Groussin Emilien, Pr\\u00e9sident de la SARL PLUS UN MUSIC SERVICES.<\\/p>\\n<p>&nbsp;<\\/p>\\n<h2>Article 2 : Acc\\u00e8s au Site.<\\/h2>\\n<p>Les pr\\u00e9sentes conditions encadrent l\\u2019utilisation du site de la soci\\u00e9t\\u00e9 Plus Un Music Services (ci-apr\\u00e8s d\\u00e9nomm\\u00e9 \\u00ab le Site \\u00bb) par les personnes naviguant sur le Site (les \\u00ab Internautes \\u00bb ou \\u00ab vous \\u00bb ). En naviguant sur le Site, vous reconnaissez avoir pris connaissance et acceptez pleinement et sans r\\u00e9serve ces conditions qui peuvent \\u00eatre modifi\\u00e9es \\u00e0 tout moment.<br>\\nLe Site permet aux Internautes disposant d\\u2019une connexion internet de naviguer et de consulter la liste des diff\\u00e9rents services propos\\u00e9s par Plus Un Music Services.<\\/p>\\n<h2><\\/h2>\\n<h2>Article 3 : Collecte des donn\\u00e9es.<\\/h2>\\n<p>Lors de la navigation sur le Site, seuls des cookies de donn\\u00e9es techniques (logs) n\\u00e9cessaires \\u00e0 l\\u2019acc\\u00e8s au Site ou \\u00e0 la tra\\u00e7abilit\\u00e9 ou des cookies de mesure d\\u2019audience ou des cookies r\\u00e9seaux sociaux (avec votre consentement) peuvent \\u00eatre d\\u00e9pos\\u00e9s. Les cookies correspondent \\u00e0 de petits fichiers d\\u00e9pos\\u00e9s temporairement sur le disque dur de votre terminal. Si vous y consentez via le bandeau Cookie, le Groupe Meta (comprenant Facebook, Instagram et WhatsApp), LinkedIn, X (ex-twitter), TikTok, et Google Analytics d\\u00e9poseront des traceurs sur votre terminal et acc\\u00e8deront \\u00e0 certaines de vos donn\\u00e9es pour vous permettre de partager du contenu directement sur vos comptes de r\\u00e9seaux sociaux ou pour mesurer l\\u2019audience du Site et suivre le trafic ; conform\\u00e9ment \\u00e0 leurs Politiques de confidentialit\\u00e9 et l\\u2019information donn\\u00e9e au sein du bandeau cookies. Ils ne sont utilis\\u00e9s qu\'\\u00e0 des fins statistiques et ne permettent pas de vous identifier personnellement. Les cookies sont stock\\u00e9s sur votre navigateur pour une dur\\u00e9e maximale de 14 mois. Pass\\u00e9 ce d\\u00e9lai, les donn\\u00e9es collect\\u00e9es seront supprim\\u00e9es automatiquement. Vous pouvez \\u00e0 tout moment revenir sur vos choix conform\\u00e9ment aux param\\u00e8tres de votre navigateur ou en utilisant le module de d\\u00e9sactivation de Google Analytics.<\\/p>\\n<p>Lorsque vous contactez Plus Un Music Services via le formulaire de contact, les donn\\u00e9es (champs obligatoires) transmises sont n\\u00e9cessaires au traitement de la demande et les donn\\u00e9es facultatives permettent d\\u2019affiner la r\\u00e9ponse de la soci\\u00e9t\\u00e9, ce \\u00e0 quoi vous consentez express\\u00e9ment en envoyant le formulaire de contact. Les donn\\u00e9es relatives \\u00e0 ce formulaire ainsi que les r\\u00e9ponses apport\\u00e9es sont conserv\\u00e9es pendant 2 ans \\u00e0 compter du dernier contact. Ces donn\\u00e9es sont transmises aux services comp\\u00e9tents de Plus Un Music Services. Conform\\u00e9ment \\u00e0 la r\\u00e9glementation en vigueur en France, vous b\\u00e9n\\u00e9ficiez d\\u2019un droit d\\u2019acc\\u00e8s, de limitation, de portabilit\\u00e9 et de rectification aux informations qui vous concernent. L\\u2019exercice de ce droit s\\u2019effectue gr\\u00e2ce au formulaire de contact. En cas de r\\u00e9ponse insatisfaisante, vous pouvez introduire une r\\u00e9clamation aupr\\u00e8s de la Commission Nationale de l\\u2019Informatique et des Libert\\u00e9s (CNIL).<\\/p>\\n<h2><\\/h2>\\n<h2>Article 5 : Propri\\u00e9t\\u00e9 intellectuelle.<\\/h2>\\n<p>Plus Un Music Services d\\u00e9tient seul les droits de propri\\u00e9t\\u00e9 intellectuelle aff\\u00e9rents au Site, qui demeure sa propri\\u00e9t\\u00e9 exclusive. L\\u2019Internaute s\'interdit donc d\\u2019utiliser, de reproduire, directement ou indirectement, en totalit\\u00e9 ou en partie, d\'adapter, de modifier, de traduire, de repr\\u00e9senter, de commercialiser ou de diffuser \\u00e0 toute personne, tout ou partie du Site, sans l\'autorisation expresse et \\u00e9crite de Plus Un Music Services.<\\/p>\\n<h2><\\/h2>\\n<h2>Article 6 : Responsabilit\\u00e9.<\\/h2>\\n<p>Plus Un Music Services veille au bon fonctionnement du Site et \\u00e0 la mise \\u00e0 jour des contenus du Site, cependant, elle ne pourra \\u00eatre tenu responsable de tout dommage, qu\\u2019il soit direct ou indirect, r\\u00e9sultant de l\\u2019interruption d\\u2019acc\\u00e8s au Site, de l\\u2019utilisation du Site ou r\\u00e9sultant de toute erreur ou omission dans le contenu du Site.<\\/p>\\n<h2><\\/h2>\\n<h2>Article 7 : Liens hypertextes.<\\/h2>\\n<p>Le Site peut contenir des liens hypertextes pointant vers des sites tiers sur lesquels Plus Un Music Services n\\u2019exerce aucun contr\\u00f4le. Malgr\\u00e9 les v\\u00e9rifications pr\\u00e9alables r\\u00e9alis\\u00e9es, Plus Un Music Services ne pourra \\u00eatre tenue responsable quant aux contenus point\\u00e9s. L\\u2019autorisation pr\\u00e9alable de Plus Un Music Services est n\\u00e9cessaire avant toute insertion d\\u2019un lien hypertexte pointant vers le Site ; faute de quoi, Plus Un Music Services pourra demander la suppression dudit lien hypertexte.<\\/p>\\n<h2><\\/h2>\\n<h2>Article 8 : Droit applicable et juridiction comp\\u00e9tente.<\\/h2>\\n<p>Les pr\\u00e9sentes conditions sont soumises \\u00e0 la loi fran\\u00e7aise. Le tribunal comp\\u00e9tent en cas de litige sera celui du lieu de domicile du d\\u00e9fendeur.<\\/p>\",\"align\":\"justify\",\"text_color\":\"#FFFADE\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}]');
