u00e9 ou des cookies de mesure d\\u2019audience ou des cookies r\\u00e9seaux sociaux (avec votre consentement) peuvent \\u00eatre d\\u00e9pos\\u00e9s. Les cookies correspondent \\u00e0 de petits fichiers d\\u00e9pos\\u00e9s temporairement sur le disque dur de votre terminal. Si vous y consentez via le bandeau Cookie, le Groupe Meta (comprenant Facebook, Instagram et WhatsApp), LinkedIn, X (ex-twitter), TikTok, et Google Analytics d\\u00e9poseront des traceurs sur votre terminal et acc\\u00e8deront \\u00e0 certaines de vos donn\\u00e9es pour vous permettre de partager du contenu directement sur vos comptes de r\\u00e9seaux sociaux ou pour mesurer l\\u2019audience du Site et suivre le trafic ; conform\\u00e9ment \\u00e0 leurs Politiques de confidentialit\\u00e9 et l\\u2019information donn\\u00e9e au sein du bandeau cookies. Ils ne sont utilis\\u00e9s qu\'\\u00e0 des fins statistiques et ne permettent pas de vous identifier personnellement. Les cookies sont stock\\u00e9s sur votre navigateur pour une dur\\u00e9e maximale de 14 mois. Pass\\u00e9 ce d\\u00e9lai, les donn\\u00e9es collect\\u00e9es seront supprim\\u00e9es automatiquement. Vous pouvez \\u00e0 tout moment revenir sur vos choix conform\\u00e9ment aux param\\u00e8tres de votre navigateur ou en utilisant le module de d\\u00e9sactivation de Google Analytics.<\\/p>\\n<p>Lorsque vous contactez Plus Un Music Services via le formulaire de contact, les donn\\u00e9es (champs obligatoires) transmises sont n\\u00e9cessaires au traitement de la demande et les donn\\u00e9es facultatives permettent d\\u2019affiner la r\\u00e9ponse de la soci\\u00e9t\\u00e9, ce \\u00e0 quoi vous consentez express\\u00e9ment en envoyant le formulaire de contact. Les donn\\u00e9es relatives \\u00e0 ce formulaire ainsi que les r\\u00e9ponses apport\\u00e9es sont conserv\\u00e9es pendant 2 ans \\u00e0 compter du dernier contact. Ces donn\\u00e9es sont transmises aux services comp\\u00e9tents de Plus Un Music Services. Conform\\u00e9ment \\u00e0