ence du Site et suivre le trafic ; conformment  leurs Politiques de confidentialit et linformation donne au sein du bandeau cookies. Ils ne sont utiliss qu\' des fins statistiques et ne permettent pas de vous identifier personnellement. Les cookies sont stocks sur votre navigateur pour une dure maximale de 14 mois. Pass ce dlai, les donnes collectes seront supprimes automatiquement. Vous pouvez  tout moment revenir sur vos choix conformment aux paramtres de votre navigateur ou en utilisant le module de dsactivation de Google Analytics.\n\nLorsque vous contactez Plus Un Music Services via le formulaire de contact, les donnes (champs obligatoires) transmises sont ncessaires au traitement de la demande et les donnes facultatives permettent daffiner la rponse de la socit, ce  quoi vous consentez expressment en envoyant le formulaire de contact. Les donnes relatives  ce formulaire ainsi que les rponses apportes sont conserves pendant 2 ans  compter du dernier contact. Ces donnes sont transmises aux services comptents de Plus Un Music Services. Conformment  la rglementation en vigueur en France, vous bnficiez dun droit daccs, de limitation, de portabilit et de rectification aux informations qui vous concernent. Lexercice de ce droit seffectue grce au formulaire de contact. En cas de rponse insatisfaisante, vous pouvez introduire une rclamation auprs de la Commission Nationale de lInformatique et des Liberts (CNIL).\n<h2></h2>\n<h2>Article 5 : Proprit intellectuelle.</h2>\nPlus Un Music Services dtient seul les droits de proprit intellectuelle affrents au Site, qui demeure sa proprit exclusive. LInternaute s\'interdit donc dutiliser, de reproduire, directement ou indirectement, en totalit ou en partie, d\'adapter, de modifier, de traduire, de reprsenter, de commercialiser ou de diffuser  toute personne, tout ou partie du Site, sans l\'autorisation expresse et crite de Plus Un Music Services.\n<h2></h2>\n<h2>Article 6 : Responsabilit.</h2>\nPlus Un Music Services veille au bon fonctionnement du Site et  la mise  jour des contenus du Site, cependant, elle ne pourra tre tenu responsable de tout dommage, quil soit direct ou indirect, rsultant de linterruption daccs au Site, de lutilisation du Site ou rsultant de toute erreur ou omission dans le contenu du Site.\n<h2></h2>\n<h2>Article 7 : Liens hypertextes.</h2>\nLe Site peut contenir des liens hypertextes pointant vers des sites tiers sur lesquels Plus Un Music Services nexerce aucun contrle. Malgr les vrifications pralables ralises, Plus Un Music Services ne pourra tre tenue responsable quant aux contenus points. Lautorisation pralable de Plus Un Music Services est ncessaire avant toute insertion dun lien hypertexte pointant vers le Site ; faute de quoi, Plus Un Music Services pourra demander la suppression dudit lien hypertexte.\n<h2></h2>\n<h2>Article 8 : Droit applicable et juridiction comptente.</h2>\nLes prsentes conditions sont soumises  la loi franaise. Le tribunal comptent en cas de litige sera celui du lieu de domicile du dfendeur.','MENTION LGALES & CGU','','publish','closed','open','','mentions-legales-cgu','','','2024-09-30 09:41:35','2024-09-30 09:41:35','',0,'https://plusunmusic.com/?page_id=3',17,'page','',0);
